package BFS;

import java.util.PriorityQueue;
import java.util.Scanner;

class pipe implements Comparable<pipe> {
	int x;
	int y;

	pipe(int x, int y) {
		this.x = x;
		this.y = y;
	}

	@Override
	public int compareTo(pipe o) {
		if (o.y == this.y)
			return this.y - o.y;
		return o.y - this.y;
	}
}

public class BFS_3109 {
	static char[][] map;
//	static boolean[][] used;
	static int[] dx = { -1, 0, 1 };
	static int[] dy = { 1, 1, 1 };
	static int ans = 0;

	public static void main(String[] args) {
		Scanner sc = new Scanner(System.in);
		int Row = sc.nextInt();
		int Column = sc.nextInt();
		sc.nextLine();
		map = new char[Row + 1][Column + 1];
//		used = new boolean[Row + 1][Column + 1];
		PriorityQueue<pipe> queue = new PriorityQueue<pipe>();
		for (int i = 1; i <= Row; i++) {
			String str = sc.nextLine();
			for (int j = 1; j <= Column; j++) {
				map[i][j] = str.charAt(j - 1);
			}
		}

		for (int i = 1; i <= Row; i++) {
			queue.add(new pipe(i, 1));
			map[i][1] = 'x';
//			used[i][1] = true;
			while (!queue.isEmpty()) {
				pipe p = queue.poll();
				map[p.x][p.y] = 'x';
//				boolean check = false;
				for (int j = 0; j < 3; j++) {
//					if(check) break;
					int ax = p.x + dx[j];
					int ay = p.y + dy[j];

					if (ax < 1 || ax > Row || map[ax][ay] == 'x')
						continue;
//					System.out.println();
//					check = true;
					if (ay == Column) {
						ans++;
						queue.clear();
						break;
					}
					queue.add(new pipe(ax, ay));
				}
			}
		}
		System.out.println(ans);
		sc.close();

	}
}

